import React, { useState } from 'react';
import { motion } from 'framer-motion';
import { Plus, Timer } from 'lucide-react';

const ExerciseForm = ({ onAddExercise }) => {
  const [name, setName] = useState('');
  const [sets, setSets] = useState('');
  const [reps, setReps] = useState('');
  const [weight, setWeight] = useState('');
  const [restTime, setRestTime] = useState('');

  const handleSubmit = (e) => {
    e.preventDefault();
    
    if (!name || !sets || !reps) {
      return;
    }

    const exercise = {
      id: Date.now().toString(),
      name,
      sets: parseInt(sets),
      reps: parseInt(reps),
      weight: weight ? parseFloat(weight) : null,
      restTime: restTime ? parseInt(restTime) : null
    };

    onAddExercise(exercise);
    
    // Reset form
    setName('');
    setSets('');
    setReps('');
    setWeight('');
    setRestTime('');
  };

  return (
    <motion.form
      initial={{ opacity: 0, y: 20 }}
      animate={{ opacity: 1, y: 0 }}
      className="space-y-4"
      onSubmit={handleSubmit}
    >
      <div className="grid grid-cols-1 md:grid-cols-2 gap-4">
        <div>
          <label htmlFor="name" className="block text-sm font-medium text-gray-700 dark:text-gray-300 mb-1">
            Nome do Exercício
          </label>
          <input
            type="text"
            id="name"
            value={name}
            onChange={(e) => setName(e.target.value)}
            className="w-full px-4 py-2 border border-gray-300 dark:border-gray-600 rounded-lg focus:ring-2 focus:ring-primary-500 focus:border-transparent dark:bg-gray-700 dark:text-white"
            placeholder="ex: Supino, Agachamento, etc."
            required
          />
        </div>

        <div>
          <label htmlFor="sets" className="block text-sm font-medium text-gray-700 dark:text-gray-300 mb-1">
            Séries
          </label>
          <input
            type="number"
            id="sets"
            value={sets}
            onChange={(e) => setSets(e.target.value)}
            className="w-full px-4 py-2 border border-gray-300 dark:border-gray-600 rounded-lg focus:ring-2 focus:ring-primary-500 focus:border-transparent dark:bg-gray-700 dark:text-white"
            placeholder="ex: 3"
            min="1"
            required
          />
        </div>

        <div>
          <label htmlFor="reps" className="block text-sm font-medium text-gray-700 dark:text-gray-300 mb-1">
            Repetições
          </label>
          <input
            type="number"
            id="reps"
            value={reps}
            onChange={(e) => setReps(e.target.value)}
            className="w-full px-4 py-2 border border-gray-300 dark:border-gray-600 rounded-lg focus:ring-2 focus:ring-primary-500 focus:border-transparent dark:bg-gray-700 dark:text-white"
            placeholder="ex: 12"
            min="1"
            required
          />
        </div>

        <div>
          <label htmlFor="weight" className="block text-sm font-medium text-gray-700 dark:text-gray-300 mb-1">
            Peso (kg)
          </label>
          <input
            type="number"
            id="weight"
            value={weight}
            onChange={(e) => setWeight(e.target.value)}
            className="w-full px-4 py-2 border border-gray-300 dark:border-gray-600 rounded-lg focus:ring-2 focus:ring-primary-500 focus:border-transparent dark:bg-gray-700 dark:text-white"
            placeholder="ex: 20"
            min="0"
            step="0.5"
          />
        </div>

        <div>
          <label htmlFor="restTime" className="block text-sm font-medium text-gray-700 dark:text-gray-300 mb-1">
            Tempo de Descanso (segundos)
          </label>
          <div className="relative">
            <input
              type="number"
              id="restTime"
              value={restTime}
              onChange={(e) => setRestTime(e.target.value)}
              className="w-full px-4 py-2 border border-gray-300 dark:border-gray-600 rounded-lg focus:ring-2 focus:ring-primary-500 focus:border-transparent dark:bg-gray-700 dark:text-white"
              placeholder="ex: 60"
              min="0"
            />
            <Timer className="absolute right-3 top-1/2 transform -translate-y-1/2 w-4 h-4 text-gray-400" />
          </div>
        </div>
      </div>

      <motion.button
        whileHover={{ scale: 1.02 }}
        whileTap={{ scale: 0.98 }}
        type="submit"
        className="w-full flex items-center justify-center px-4 py-2 bg-primary-500 text-white rounded-lg hover:bg-primary-600 transition-colors"
      >
        <Plus className="w-4 h-4 mr-2" />
        Adicionar Exercício
      </motion.button>
    </motion.form>
  );
};

export default ExerciseForm;
